import React from 'react';
import styled from 'styled-components'
import {Link} from "react-router-dom";
import { FaEdit, FaSearch } from "react-icons/fa";

import Button from 'react-bootstrap/Button'

const Title = styled.h4`

font-size: 28px;
font-weight: 800;
color: #002337;
  `

const BtnFollow = styled(Link)`
color: #F7A70A;
border: solid 1px #F7A70A;
border-radius: 2px;
text-align: center;
height: 30px;
width: 80px;
  `

const BtnCreate = styled(Link)`
background-color: #002337;
color: white;
border-radius: 2px;
text-align: center;
height: 30px;
  `
const BtnSearch = styled(Link)`
background-color: #002337;
color: white;
border-radius: 2px;
text-align: center;
height: 30px;
  `

export default () => {
    return (
        <div className="container">
            <div className="d-flex row">
                <Title className="mt-2 mb-2 mr-5">
                    RESTAURANTS
                </Title>
                <BtnFollow className="align-self-center">Follow</BtnFollow>
            </div>
            <div className="d-flex">
                <BtnCreate className="col-10 ml-0">
                    <FaEdit /> Create Post
                </BtnCreate>
                <BtnSearch className="col-2">
                    <FaSearch />
                </BtnSearch>

            </div>


        </div>

    )

}
